import React from 'react';
import './App.css';
/* import BuyList from './BuyList'; */

class App extends React.Component {
  render() {
  const shoppingList = ['leite', 'arroz', 'feijão', 'banana', 'carne'];
  const items = shoppingList.map((item, index) => <li key={'index'}>{item}</li>);

    return (
      <div className="App">
        <ul>
          { items }
        </ul>
      </div>
    );
  }
}

export default App;
